    [],nt"revision_timestamp": "2015-05-06T22:26:04.414193",nt"name": "semi-tandem-electric-distributed-wing-zip-aviation-advanced-concept-project",nt"isopen":
    true,nt"url": null,nt"notes": "&lt;p&gt;Electric Propulsion (EP) is a rapidly
    developing technology frontier that opens up the degrees of freedom for aircraft
    design/integration.&amp;nbsp; Inherently EP wants to distribute across the airframe
    due to it&amp;#39;s scale-free nature, this lets the thrust be located for optimal
    drag. Electric motors are highly compact and reliable. The efficiency and power
    to weight of electric motors/controllers are relatively insensitive to scale (not
    true for internal combusion or Turbine engines). Distributed EP permits high degrees
    of coupling between the aerodynamics, propulsion, control, acoustics, and even the
    structure to enable large multi-disciplinary synergistic benefits.&amp;nbsp;&lt;/p&gt;",nt"license_title":
